import React, { Component } from 'react';


import '../css/CellPhoneApp.css';


export default class CellPhoneApp extends Component {

    render() {
        return (
            <div id="CellPhoneApp" className="CellPhoneApp">
                <div id="CellPhoneAppPhoneIcon" className="CellPhoneAppPhoneIcon"></div>
            </div>
        );
    }
}
